import pic from "./../../public/assets/";
const Diary = () => {
    const { id } = useParams();
    //해당 객체 가져옴
    const getData = useSelector((it) => it.write.writeList[id]);

    console.log(getData);
    console.log(id);

    return (
        <div className="Diary">
            <MyHeader headText={`그 날의 기록`} leftChild={<MyButton text={"뒤로가기"} />} rightChild={<MyButton text={"수정하기"} />} />
            <section>
                <h4>그 날의 감정</h4>
                <img src={`./../../public/assets/emotion${getData.emotion}.png`} />
            </section>
        </div>
    );
};

export default Diary;
